import { Link, Route, Routes } from "react-router-dom";
import Welcome from "./components/Welcome";
import Products from "./components/Products";
import ProductsList from "./components/ProductsList";
import ErrorF from "./components/ErrorF";
import Home from "./components/Home";
import NewProduct from "./components/NewProduct";
import ProductMenu from "./ProductMenu";

function App() {
  return (
    <div>
      <Routes location="/products">
        <Route path="/products" element={<h2>Title</h2>} />
        <Route path="/welcome" element={<h2> welcome</h2>} />
      </Routes>
      <nav>
        <ul>
          <li>
            <Link to="/products">PRODUCTS</Link>
          </li>
          <li>
            <Link to="/welcome">welcome</Link>
          </li>
        </ul>
      </nav>
      <Routes>
        <Route path="/" element={<Home />} />

        <Route path="/products" element={<ProductMenu />}>
          <Route index element={<Products />} />
          <Route path=":id" element={<ProductsList />}></Route>
          <Route path="new" element={<NewProduct />}></Route>
        </Route>

        {/* <Route path="/products" element={<Products />} />

        <Route path="/products/:id" element={<ProductsList />} /> */}
        <Route path="/welcome" element={<Welcome />} />
        <Route path="*" element={<ErrorF />} />
      </Routes>
    </div>
  );
}

export default App;
